It took me a while to figure out how this worked, and I'm not sure I like the APIs because SetRfStatusLen is going to set all fields to that same value.

Instead of having that many global variables, please declare a structure to store one RfDeviceStatus:

typedef struct {
 bool isValid;
 uint16_t manufacturedId;
 uint8_t productId;
 bool status;
}
RfDeviceStatus_t;

Then declare an array of that structure:
RfDeviceStatus_t RfDeviceStatus[LE_INFO_RF_DEVICES_STATUS_MAX] = {0};

Then you can update the SetRfDeviceStatus to update one id and not the whole array:
pa_infoSimu_SetRfDeviceStatus(int id, bool isValid, ...) { ... }

That way you can control all entries of the array independently. You can also control the validity of each entry of the array (if isValid is false, the value would not be accessibly from GetRfDeviceStatus).

